import React, { useEffect, useState } from "react";
import Title from "../custom/Title";
import { socket } from "../../config/socket";
import Chart from "../custom/Chart";

const FinalReport = () => {
  const [profit, setProfits] = useState(0);
  useEffect(() => {
    function onProfitsData(data) {
      setProfits(data);
    }
    socket.on("profits", (data) => onProfitsData(data));
  }, []);
  return (
    <div className=" w-screen h-screen flex flex-col">
      <div className=" flex justify-center items-center m-5">
        <Title text="Reporte final" />
      </div>
      <div className=" h-4/5 flex justify-center items-center">
        <Chart />
        <div className=" w-3/5 bg-rosa">
          <h2 className=" text-center text-5xl font-[Dosis] gap-5">
            Ganancias
          </h2>
          <h3 className=" text-4xl text-center font-[Dosis] gap-5">{profit}</h3>
        </div>
      </div>
    </div>
  );
};

export default FinalReport;
